import React from 'react';
import ProductItem from './ProductItem';

const productsData = {
  shirts: Array.from({ length: 5 }, (_, i) => ({ id: i + 1, name: `Shirt ${i + 1}`, price: 20, imageUrl: 'src/images/tshirt1.webp' })),
  tshirts: Array.from({ length: 5 }, (_, i) => ({ id: i + 11, name: `T-shirt ${i + 1}`, price: 15, imageUrl: 'https://via.placeholder.com/150' })),
  hoodies: Array.from({ length: 5 }, (_, i) => ({ id: i + 21, name: `Hoodie ${i + 1}`, price: 30, imageUrl: 'https://via.placeholder.com/150' })),
  sweatshirts: Array.from({ length: 5 }, (_, i) => ({ id: i + 31, name: `Sweatshirt ${i + 1}`, price: 25, imageUrl: 'https://via.placeholder.com/150' })),
  joggers: Array.from({ length: 5}, (_, i) => ({ id: i + 41, name: `Jogger ${i + 1}`, price: 20, imageUrl: 'https://via.placeholder.com/150' })),
  accessories: Array.from({ length: 5 }, (_, i) => ({ id: i + 51, name: `Accessory ${i + 1}`, price: 10, imageUrl: 'https://via.placeholder.com/150' })),
};

function ProductList() {
  return (
    <div className="product-categories">
      {Object.keys(productsData).map((category) => (
        <div key={category} className="category-section">
          <h2 className="category-title">{category.charAt(0).toUpperCase() + category.slice(1)}</h2>
          <div className="product-list">
            {productsData[category].map((product) => (
              <ProductItem key={product.id} product={product} />
            ))}
          </div>
        </div>
      ))}
    </div>
  );
}

export default ProductList;
